import React from 'react';

import Resource from './Resource';
import '../css/resources.css';

const Resources = () => {

    return (
        <div>
            Select resource
            <Resource id={0} />
            <Resource id={1} />
            <Resource id={2} />
        </div>
    );
};

export default Resources;
